import { combineReducers } from 'redux';

import { addLogIn } from './addLogIn'
import { addNewOrder } from './addNewOrder'
import { addOrder } from './addOrders'

export const rootReducer = combineReducers({

  logIn: addLogIn,
  newOrder: addNewOrder,
  orders: addOrder,

})
